//import { useState } from 'react';
import './apiSidebar.css';
import { NavLink } from 'react-router-dom';
import Sticky from 'react-stickynode';
function ApiSide(props) {
    // const [active, setActive] = useState(false)
    // const clickLink = () => {
    //     setActive(true)
    // }
    return (
        <Sticky>
            <aside className="sticky-top pb-1 sideBar">
                <div className="widget">

                    <ul className="service-menu">
                        <li className=""><NavLink activeClassName="active-link" to="/api/welcome"><span>Welcomes</span><i className="fa fa-angle-right"></i></NavLink></li>
                        <br />
                        <h6>GENERAL</h6>
                        <li className=""><NavLink activeClassName="active-link" to="/api/getting-started"><span>Getting Started</span><i className="fa fa-angle-right"></i></NavLink></li>
                        <li className=""><NavLink activeClassName="active-link" to="/api/introduction"><span>Introduction</span><i className="fa fa-angle-right"></i></NavLink></li>
                        <li ><NavLink to="/api/authentication"><span>Authentication</span><i className="fa fa-angle-right"></i></NavLink></li>
                        <li><NavLink to="/api/about-verification"><span>About Verifications</span><i className="fa fa-angle-right"></i></NavLink></li>
                        <br />
                        <h6>NATIONAL ID CARD CHECKS</h6>
                        <li><NavLink to="/api/user/nin"><span>Verify User By NIN ID</span><i className="fa fa-angle-right"></i></NavLink></li>
                        <li><NavLink to="/api/user/phone"><span>Verify User By Phone No</span><i className="fa fa-angle-right"></i></NavLink></li>
                        <li><NavLink to="/api/user/fingerprint"><span>Verify  User by Fingerprint</span><i className="fa fa-angle-right"></i></NavLink></li>
                        <br />
                        <h6>NATIONAL ID VERIFICATIUON</h6>
                        <li><NavLink to="/api/user_id/nin"><span>Verify User By NIN ID</span><i className="fa fa-angle-right"></i></NavLink></li>
                        <li><NavLink to="/api/user_id/phone"><span>Verify User By Phone No</span><i className="fa fa-angle-right"></i></NavLink></li>
                        <li><NavLink to="/api/user_id/fingerprint"><span>Verify  User by Fingerprint</span><i className="fa fa-angle-right"></i></NavLink></li>
                        <br />
                        {/* <h6>IDENTITY VERIFICATIONS</h6>
                        <li><NavLink to="/api/bvn"><span>Bank Verification Numbers (BVN)</span><i className="fa fa-angle-right"></i></NavLink></li>
                        <li><NavLink to="/api/cac"><span>Corporate Affairs Commission</span><i className="fa fa-angle-right"></i></NavLink></li>
                        <li><NavLink to="/api/driver-licence"><span>Driver License</span><i className="fa fa-angle-right"></i></NavLink></li>
                        <li><NavLink to="/api/identity-biometrics"><span>Identity Biometrics</span><i className="fa fa-angle-right"></i></NavLink></li>
                        <li><NavLink to="/api/identity-matching"><span>Identity Matching</span><i className="fa fa-angle-right"></i></NavLink></li>
                        <li><NavLink to="/api/nin"><span>National Identity</span><i className="fa fa-angle-right"></i></NavLink></li>
                        <li><NavLink to="/api/tin"><span>Tax Identification Number</span><i className="fa fa-angle-right"></i></NavLink></li>
                        <li><NavLink to="/api/voterscard"><span>Voters Card</span><i className="fa fa-angle-right"></i></NavLink></li>
                        <br /> */}
                        <h6>ADDRESS VERIFICATIONS</h6>
                        <li><NavLink to="/service-detail"><span>Submit Address Verification</span><i className="fa fa-angle-right"></i></NavLink></li>
                        <li><NavLink to="/service-detail"><span>Get Address Verification By ID</span><i className="fa fa-angle-right"></i></NavLink></li>
                        <li><NavLink to="/service-detail"><span>Get Address Verifications</span><i className="fa fa-angle-right"></i></NavLink></li>
                        <li><NavLink to="/service-detail"><span>Cancel Address verification</span><i className="fa fa-angle-right"></i></NavLink></li>
                        <li><NavLink to="/service-detail"><span>Fetch an Address By Identity</span><i className="fa fa-angle-right"></i></NavLink></li>
                    </ul>
                </div>
            </aside>
        </Sticky>
    );
}

export default ApiSide;
